import React from 'react'
import {  TextField, IconButton } from '@material-ui/core';
import { SearchOutlined } from '@material-ui/icons';

function Searchbar() {
  return (
    <div className='bg-searchbg h-[50px] flex px-5 py-2 justify-between'>
    <TextField
    fullWidth
    id="standard-bare"
    variant="outlined"
    defaultValue="How can we help"
    InputProps={{
      endAdornment: (
        <IconButton>
          <SearchOutlined />
        </IconButton>
      ),
    }}
  />
        <button className='bg-orange rounded-[10px] px-5 py-2 text-xs font-bold'>List Property</button>
    </div>
  )
}

export default Searchbar
